import Vue from "vue";
import Router from "vue-router";
import Main from "@App.vue";

Vue.use(Router);

export default new Router({
  mode: "history",
  base: process.env.BASE_URL,
  routes: [
    {
      path: "/",
      name: "home",
      component: Main,
    },
    {
      path: "/lesson",
      name: "Lesson",
      component: () => import("./components/lesson-template.vue"),
    },
  ],
});
